import { StyleSheet } from 'react-native';

const style = () => {
  console.log('styling...');
  return (StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#fff',
      alignItems: 'center',
      justifyContent: 'center',
    },
  }));
};

export default { styles };
